import React from 'react';

function HomeContent() {
  return (
    <section>
      <h1>Olá!</h1>
      <section>
        <p>Aqui você vai encontrar</p>
        <ul>
          <li>
            <a href="projects">Projetos</a>
          </li>
          <li>
            <a href="articles">Artigos</a>
          </li>
        </ul>
        <p>desenvolvidos por mim! :)</p>
      </section>
    </section>
  );
}

export default HomeContent;
